import React, { Component } from 'react';
import Iphone from './Iphone';
import Product from './Component/Product'
import Menu from './Component/Menu/Menu'
import MenuCaro from './Component/MenuCaro/MenuCaro'
import { Container, Row ,Col} from 'react-bootstrap';
import Delivery from './Component/Delivery/Delivery'
import Nav from './Component/Navber/Nav'
import {BrowserRouter as Router,Switch,Route} from 'react-router-dom';
import Official from './Component/Official/Official';
import Deli from './Component/Deli/Deli';
import img from "./brand.jpg"

class App extends Component {
  constructor(props){
    super(props)
    this.state={
      topsell:[{
        name:"Lace-Up Canvas Casual Shoes - Blue",
        price:"GH₵ 48.00",
        imgUrl:'https://unsplash.com/photos/a-QH9MAAVNI'
      },
      {
        name:'E-Life 17G1 Digital Satellite TV - 17" Black',
        price:"GH₵ 370.50",
      },
      {
        name:'Rectangle Computer Glasses',
        price:"GH₵ 46.00",
      },
      {
        name:'T WS Bluetooth headset + ios smart watch',
        price:"GH₵ 98.00",
      },
      {
        name:'Bluetooth Wireless Stereo Earphones',
        price:"GH₵ 48.00",
      },



      ],
      phone:[
        {
          name:"iphone",
          price:'400',
          id:"owicekek"

        }
      ]
    }
  }


  render() {
    return (
      <Router>
        <Container>
          <Row>
            <Nav />
            <Col sm={3} md={3}> <Menu /></Col>
            <Col sm={6} md={6}><MenuCaro/></Col>
            <Col sm={3} md={3}><Delivery /></Col>
            <Official />
            <h3
            style={{
              textAlign: `center`,
              backgroundColor: `orangered`,
              color: `white`,
              padding: `20px`,
            }}
          >
            Top selling items
          </h3>
            <div className="box">
        <Product product={this.state.topsell}/>
        </div>
        <Deli />
        <Iphone phone={this.state.phone} />

        </Row>
        </Container>
        </Router>
    );
  }
}

export default App;
